import React from 'react';
import heroBg from '../assets/hero-bg.jpg';

function HeroSection() {
  return (
    <section
      id="hero"
      style={{
        backgroundImage: `url(${heroBg})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        color: 'white',
        padding: '100px 20px',
        textAlign: 'center'
      }}
    >
      <h1>Transforming Workspaces</h1>
      <p>Innovative designs for modern businesses</p>
      <button
        style={{
          padding: '10px 20px',
          fontSize: '1rem',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          marginTop: '20px'
        }}
      >
        Get Started
      </button>
    </section>
  );
}

export default HeroSection;
